import React from 'react';

const Home = () => (
  <div className="p-8 text-center">
    <h2 className="text-3xl font-bold mb-4">Welcome to NBFC Corp</h2>
    <p>Providing innovative financial solutions for every stage of your business journey.</p>
  </div>
);

export default Home;
